(927,	12,	'_section_builder_0_heading',	'field_60ecfab10c5ca'),
(928,	12,	'section_builder_0_content',	'It’s no accident that our projects range from property marketing to banks, brew bars to universities, city councils to symphony orchestras. In a world that tells us to specialise we offer a different view, bringing knowledge and experience from many different sources. This helps generate the divergent thinking, freshness and innovation we need in order to Make Tomorrow.\r\n\r\nIn the end it’s all about communication and emotional engagement, and that’s our specialty.'),
