(972,	12,	'section_builder_1_heading',	'Howdy'),
(973,	12,	'_section_builder_1_heading',	'field_60f4fd5103d46'),
(974,	12,	'section_builder_1_blurb',	'Hi, I’m Kelly Mitchell, Founder of Make Tomorrow.\r\n\r\nA bit about me. My background has been working with premium brand and design agencies in Sydney, London and Amsterdam. I have used an understanding of the complex emotional and functional needs of humans combined with the power of brand strategy, identity and visual communication to engage the audiences of many diverse companies, organisations and communities.\r\n\r\nIn that time I have used my skills and experience to help people achieve their various objectives, always with a view to authenticity and longevity.\r\n\r\nMy experience as business owner, father, homeowner, designer, football fan and surfer has equipped me for many of life’s challenges.'),
