(1276,	16,	'section_builder_0_heading',	'HOW IT WORKS'),
(1277,	16,	'_section_builder_0_heading',	'field_60ecfab10c5ca'),
(1278,	16,	'section_builder_0_content',	'There’s a proven methodology to this brand and design business believe it or not. And client participation is always key.\r\n\r\nWe work closely with you on addressing all the key challenges by building structure, logic and clarity to the task. That means all the important big picture stuff, like defining the desired outcomes, the vision, audience analysis, competitive context, and message hierarchy, all of which help set you apart and position you for tomorrow. Skip this part and and it’s all presumptive guesswork and window-dressing, and that’s not what we do.\r\n\r\nKey to it all is the relationship. If there’s an understanding of the impact and value that can be created when done right, then everybody wins. If you just want to jazz up your slide deck please don’t contact us.\r\n\r\nHere’s how it breaks down.'),
(1279,	16,	'_section_builder_0_content',	'field_60e4fe7e695da'),
(1280,	16,	'section_builder_0_narrowbolder',	'smallertext'),
