(1886,	193,	'section_builder_0_blurb',	'It’s no accident that our projects range from property marketing to banks, brew bars to universities, city councils to symphony orchestras. In a world that tells us to specialise we offer a different view, bringing knowledge and experience from many different sources. This helps create the freshness and innovation we need in order to Make Tomorrow.\r\n\r\nIn the end it’s all about communication and emotional engagement, and that’s our specialty.'),
